import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import {Typography} from "@material-ui/core";
import Grid from "@material-ui/core/Grid";
import {makeStyles} from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    title: {
        display: 'block',
        [theme.breakpoints.up('sm')]: {
            display: 'none',
        },
    }
}));

function App() {
    const classes = useStyles();
    return (
        <div>
            <ApplicationBar/>
            <Grid container wrap="wrap" style={{border: 'red solid 1px'}}>
                <Grid className={classes.title}  item xs={6} xsm={12} id="box1"></Grid>
                <Grid item xs={12} id="box2">
                    <div id="text">
                        <Typography variant="h1" noWrap>Hello,</Typography>
                        <Typography variant="h1" noWrap>I'm Latifa</Typography>
                    </div>
                </Grid>
            </Grid>
        </div>
    );
}

export default App;


